import React from "react";
import { useParams, Link } from "react-router-dom";
import Footer from "../Components/Footer";
import Header from "../Components/Header";
import { Helmet } from "react-helmet";

import { aktuality } from "../Data/aktualityData"; // Import the services data from NaseSluzby

const AktualityDetils = () => {
  const { title } = useParams();

  // Find the service that matches the title parameter
  const service = aktuality.find((service) => service.link === title);

  return (
    <>
      <Helmet>
        <title>{service.title} | AKZ Advokátní kancelář Zrnovský</title>
      </Helmet>
      <Header background={true} title={service ? service.title : "Details"} />
      <main></main>
      <Footer bottom={true} />
    </>
  );
};

export default AktualityDetils;
